class Solution {
    public int trap(int[] height) {
        int n = height.length, totalWater = 0;
        int leftMax[] = new int[n];
        int rightMax[] = new int[n];

        leftMax[0] = height[0];
        for ( int i = 1; i < n; i += 1 ){
            leftMax[i] = Math.max(leftMax[i - 1], height[i]);
        }

        rightMax[n - 1] = height[n - 1];
        for ( int i = n - 2; i >= 0; i -= 1 ){
            rightMax[i] = Math.max(rightMax[i + 1], height[i]);
        }

        for ( int i = 0; i < n; i += 1 ){
            totalWater += Math.min(leftMax[i], rightMax[i]) - height[i];
        }

        return totalWater;

    }
}

class Solution {
    public int trap(int[] height) {
        int count=0,n=height.length;
        int l=0,leftmost=height[0];
        int r=n-1,rightmost=height[n-1];
        while(l<r){
        leftmost=Math.max(height[l],leftmost);
        rightmost=Math.max(height[r],rightmost);
        if(leftmost<rightmost){
            count+=leftmost-height[l];
            l++;
        }else{
            count+=rightmost-height[r];
            r--;
        }
        }
        return count;
    }
}

class Solution {
    public int trap(int[] height) {
        int n = height.length;
        int[] prefixMax = new int[n];
        int[] suffixMax = new int[n];
        prefixMax[0] = height[0];
        for (int i = 1; i < n; i++) {
            prefixMax[i] = Math.max(prefixMax[i - 1], height[i]);
        }
        suffixMax[n - 1] = height[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            suffixMax[i] = Math.max(suffixMax[i + 1], height[i]);
        }
        int waterTrapped = 0;
        for (int i = 0; i < n; i++) {
            waterTrapped += Math.min(prefixMax[i], suffixMax[i]) - height[i];
        }

        return waterTrapped;
    }
}

