class Solution {
    public int trap(int[] height) {
        int left=0;
        while(left<height.length && height[left]==0){
            left++;
        }
        int right=height.length-1;
        while(right>-1 && height[right]==0){
            right--;
        }
        int ptr=0;
        int ptr2=0;
        int sum=0;
        int direction=0;
        while(left<right){
            if(height[left]<=height[right]){
                ptr=left;
                ptr2=left;
                direction=0;
                boolean flag=true;
                while(ptr2<=right && (height[ptr2]<height[left] || flag)){
                    ptr2++;
                    flag=false;
                }
                // System.out.println("DIRECTION: 0 left: "+left+" ptr: "+ptr+" ptr2: "+ptr2);
            }
            else{
                ptr=right;
                ptr2=right;
                direction=1;
                boolean flag=true;
                while(ptr2>=left && (height[ptr2]<height[right] || flag)){
                    ptr2--;
                    flag=false;
                }
                // System.out.println("DIRECTION: 1 right: "+right+" ptr: "+ptr+" ptr2: "+ptr2);
            }
            if(direction==0){
                while(ptr<ptr2){
                    sum+=Math.min(height[left],height[ptr2])-height[ptr];
                    ptr++;
                }
                left=ptr2;
            }
            else{
                while(ptr>ptr2){
                    sum+=Math.min(height[right],height[ptr2])-height[ptr];
                    ptr--;
                }
                right=ptr2;
            }
            // System.out.println("sum :"+sum);

        }
        return sum;
    }
}

class Solution {
    public int trap(int[] height) {
        int n = height.length;
        int[] lmax =new int[n];
        int[] rmax =new int[n];
        lmax[0]=height[0];
        rmax[n-1]=height[n-1];
        for(int i=1;i<n;i++){
            lmax[i]=Math.max(lmax[i-1],height[i]);
        }
        for(int j=n-2;j>-1;j--){
            rmax[j]=Math.max(rmax[j+1],height[j]);
        }
        int capacity=0;
        for(int i=0;i<n;i++){
            capacity+=Math.min(lmax[i],rmax[i])-height[i];
        }
        return capacity;
    }
}

